types/interactivity/alpinejs/_dist/scrip.content:
import Alpine from './modules/alpinejs/3.14.9.js';

if (!window.Alpine) {
  window.Alpine = Alpine;
  window.Alpine.start();
}

types/override/_dist/style-inline.css.content:
.blockstudio-element-gallery {
  width: 100%;
  display: grid;
  grid-gap: var(--blockstudio-element-gallery--gap);
  grid-template-columns: repeat(auto-fill, minmax(var(--blockstudio-element-gallery--width), 1fr));
}
.blockstudio-element-gallery--grid .blockstudio-element-gallery__image {
  display: flex;
}
.blockstudio-element-gallery--grid .blockstudio-element-gallery__image {
  height: var(--blockstudio-element-gallery--width);
}
.blockstudio-element-gallery--masonry {
  height: 100%;
  grid-auto-rows: 20px;
}
.blockstudio-element-gallery__image {
  width: 100%;
  object-fit: cover;
}
